We can start by converting $\frac{4 \pi}{3}$ to degrees. Since $\pi$ radians is equal to $180$ degrees, we have $\frac{4 \pi}{3} = \frac{4 \pi}{3} \cdot \frac{180}{\pi} = 240$ degrees.

