Find $\\begin{pmatrix} 1 & 5 \\\\ -2 & 4:
To find the sum of two matrices, we simply add the corresponding entries. 
\begin{align*}
\begin{pmatrix} 1 & 5 \\ -2 & 4 \end{pmatrix} + \begin{pmatrix} 0 & -3 \\ 8 & -5 \end{pmatrix} &= \begin{pmatrix} 1+0 & 5+(-3) \\ -2+8 & 4+(-5) \end{pmatrix} \\
&= \begin{pmatrix} 1 & 2 \\ 6 & -1 \end{pmatrix}
\end{align*}Thus, the answer is $\boxed{\begin{pmatrix} 1 & 2 \\ 6 & -1 \end{pmatrix}}.$

